const HamburgerToggle = props => (
    <button className="toggle-button">
        <div className="button-line">hi</div>
        <div className="button-line">twes</div>
        <div className="button-line"></div>
        <style jsx>{`
        .toggle-button {
            display: flex;
            flex-direction: column;
            background: #333333;
            margin-left: 0.5rem;
            height: 300px;
            width: 300px;  
            border: none;  
            cursor: pointer;   
        }

        .toggle-button:focus {
            outline:none;
        }

        .button-line {
            width: 300px;
            height: 100px:
            background: red;
            z-index: 1;
            

        }
    `} </style>
    </button>
    
);

export default HamburgerToggle;
